					["custom"] = "local classes = {\n    WARRIOR = \"Warrior\",\n    PALADIN = \"Paladin\",\n    HUNTER = \"Hunter\",\n    ROGUE = \"Rogue\",\n    PRIEST = \"Priest\",\n    DEATHKNIGHT = \"Death Knight\",\n    SHAMAN = \"Shaman\",\n    MAGE = \"Mage\",\n    WARLOCK = \"Warlock\",\n    DRUID = \"Druid\",\n}\nlocal CLASS = classes[UnitClassBase(\"player\")]\n\nlocal CLASS_OPTIONS = \"Class Options - \" .. CLASS\nlocal CORE_GROUP = \"Core - \" .. CLASS\nlocal RESOURCES_GROUP = \"Resources - \" .. CLASS\nlocal DYNAMIC_LEFT_GROUP = \"Dynamic Effects - \" .. CLASS\nlocal DYNAMIC_RIGHT_GROUP = \"Dynamic Spells - \" .. CLASS\nlocal LEFT_SIDE_GROUP = \"Left Side - \" .. CLASS\nlocal RIGHT_SIDE_GROUP = \"Right Side - \" .. CLASS\nlocal MAINTENANCE_GROUP = \"Maintenance - \" .. CLASS\n\nLWA = LWA or {}\n\nLWA.env = aura_env\nLWA.config = nil\nLWA.CLASS = CLASS\nLWA.RESOURCES_HEIGHT = 0\n\n\nlocal function tclone(t1)\n    local t = {}\n    \n    if t1 then\n        for k, v in pairs(t1) do\n            if \"table\" == type(v) then\n                v = tclone(v)\n            end\n            \n            if \"string\" == type(k) then\n                t[k] = v\n            else\n                tinsert(t, v)\n            end\n        end\n    end\n    \n    return t\nend\n\nlocal function tmerge(...)\n    local ts = {...}\n    local t = tclone(ts[1])\n    local t2\n    \n    for i = 2, #ts do\n        t2 = ts[i] or {}\n        \n        for k, v in pairs(t2) do\n            if \"table\" == type(v) then\n                v = tclone(v)\n                \n                if t[k] and #t[k] == 0 then\n                    t[k] = tmerge(t[k], v)\n                else\n                    t[k] = v\n                end\n            else\n                t[k] = v\n            end\n        end\n    end\n    \n    return t\nend\n\nlocal function SetRegionSize(r, w, h)\n    r:SetRegionWidth(w)\n    r:SetRegionHeight(h)\nend\n\nlocal function ResizeAnchorFrame()\n    local config = LWA.GetConfig()\n    local h = 0\n    local cr = WeakAuras.GetRegion(CORE_GROUP)\n    \n    if cr and cr:IsVisible() then\n        h = cr:GetHeight()\n    end\n    \n    SetRegionSize(LWA.env.region, LWA.GetMaxWidth(), max(1, h, config.primary.height + config.primary.spacing + LWA.RESOURCES_HEIGHT))\nend\n\nfunction LWA.GetConfig(grp)\n    local default = {\n        style = {\n            border_size = 0,\n            border_color = { [1] = 0, [2] = 0, [3] = 0, [4] = 1 },\n            apply_border = true,\n            zoom = 30,\n        },\n        primary = {\n            nb = 6,\n            width = 48,\n            height = 48,\n            spacing = 0,\n            resources_position = 2, -- Below\n        },\n        secondary = {\n            width = 32,\n            height = 32,\n            spacing = 0,\n        },\n        dynamic = {\n            width = 32,\n            height = 32,\n            spacing = 0,\n            margin = 0,\n            swap = false,\n        },\n        side = {\n            width = 32,\n            height = 32,\n            spacing = 0,\n            margin = 0,\n        },\n        maintenance = {\n            width = 32,\n            height = 32,\n            spacing = 0,\n            margin = 0,\n        },\n        ooc_alpha = {\n            alpha = 1,\n            ignore_enemy = true,\n            ignore_friendly = true,\n        },\n        resources = {\n            health_bar = {\n                format = 1\n            },\n            mana_bar = {\n                format = 1\n            }\n        },\n    }\n    \n    if not LWA.config or WeakAuras.IsOptionsOpen() then\n        LWA.config = tmerge(\n            default,\n            LWA.env.config,\n            (WeakAuras.GetData(CLASS_OPTIONS) or {}).config\n        )\n    end\n    \n    if grp then\n        return LWA.config[grp] or {}\n    end\n    \n    return LWA.config\nend\n\nfunction LWA.Init()\n    local config = LWA.GetConfig()\n    local isOptionsOpen = WeakAuras.IsOptionsOpen()\n    local zoom = config.style.zoom / 100\n    local missingData = false\n    local maxWidth = LWA.GetMaxWidth()\n    \n    local function InitIcons(group, c, anchor)\n        local data, region = WeakAuras.GetData(group)\n        \n        if missingData or not data then\n            missingData = true\n            return\n        end\n        \n        local isAbilities = CORE_GROUP == group\n        \n        for i, childId in ipairs(data.controlledChildren) do\n            childData = WeakAuras.GetData(childId)\n            region = WeakAuras.GetRegion(childId)\n            \n            region:ClearAllPoints()\n            region:SetPoint(anchor)\n            \n            if region.SetZoom then\n                region:SetZoom(zoom)\n                childData.zoom = zoom\n            else\n                print(\"LWA Issue: \" .. CLASS .. \" > \" .. group .. \" > \" .. childId)\n            end\n            \n            if isAbilities and i > config.primary.nb then\n                SetRegionSize(region, config.secondary.width, config.secondary.height)\n            else\n                SetRegionSize(region, c.width, c.height)\n            end\n            \n            LWA.UpdateBorder(region)\n        end\n    end\n    \n    InitIcons(CORE_GROUP, config.primary, \"TOP\")\n    InitIcons(LEFT_SIDE_GROUP, config.side, \"TOPRIGHT\")\n    InitIcons(RIGHT_SIDE_GROUP, config.side, \"TOPLEFT\")\n    InitIcons(MAINTENANCE_GROUP, config.maintenance, \"TOP\")\n    \n    if missingData then return end\n    \n    local function ReanchorGroup(group, selfPoint, anchorPoint)\n        local data = WeakAuras.GetData(group) or {}\n        \n        data.selfPoint = selfPoint\n        data.anchorPoint = anchorPoint\n    end\n    \n    local gL, gR\n    \n    if config.dynamic.swap then\n        gL = DYNAMIC_RIGHT_GROUP\n        gR = DYNAMIC_LEFT_GROUP\n    else\n        gL = DYNAMIC_LEFT_GROUP\n        gR = DYNAMIC_RIGHT_GROUP\n    end\n    \n    if config.dynamic.grow_center then\n        ReanchorGroup(gL, \"BOTTOMRIGHT\", \"TOP\")\n        ReanchorGroup(gR, \"BOTTOMLEFT\", \"TOP\")\n        InitIcons(gL, config.dynamic, \"BOTTOMRIGHT\")\n        InitIcons(gR, config.dynamic, \"BOTTOMLEFT\")\n    else\n        ReanchorGroup(gL, \"BOTTOMLEFT\", \"TOPLEFT\")\n        ReanchorGroup(gR, \"BOTTOMRIGHT\", \"TOPRIGHT\")\n        InitIcons(gL, config.dynamic, \"BOTTOMLEFT\")\n        InitIcons(gR, config.dynamic, \"BOTTOMRIGHT\")\n    end\n    \n    if missingData then return end\n    \n    LWA.UpdateResources()\n    \n    WeakAuras.GetRegion(DYNAMIC_LEFT_GROUP):DoPositionChildren()\n    WeakAuras.GetRegion(DYNAMIC_RIGHT_GROUP):DoPositionChildren()\n    WeakAuras.GetRegion(LEFT_SIDE_GROUP):DoPositionChildren()\n    WeakAuras.GetRegion(RIGHT_SIDE_GROUP):DoPositionChildren()\n    \n    LWA.OptionsClosedCheck()\nend\n\nfunction LWA.UpdateResources()\n    local config = LWA.GetConfig()\n    \n    local data = WeakAuras.GetData(RESOURCES_GROUP)\n    local region = WeakAuras.GetRegion(RESOURCES_GROUP)\n    \n    if not (data and region) then return end\n    \n    local h1 = config.primary.height\n    local s1 = config.primary.spacing\n    local y = 0\n    \n    if config.primary.resources_position == 2 then\n        y = h1 + s1\n    end\n    \n    region:SetOffset(0, -y)\n    \n    local isOptionsOpen = WeakAuras.IsOptionsOpen()\n    \n    local maxWidth = LWA.GetMaxWidth()\n    local totalHeight, nb = 0, 0\n    \n    local resData, resRegion, isVisible, regionType\n    local w, h, y = 0, 0, 0\n    \n    local function InitResource(id, index, nb)\n        local data, region = WeakAuras.GetData(id), WeakAuras.GetRegion(id)\n        \n        if not data then return end\n        \n        index = max(1, index or 1)\n        nb = max(1, nb or 1)\n        \n        w, h = maxWidth, 20\n        \n        if nb > 1 then\n            local s = config.primary.spacing\n            \n            w = (w + s) / nb - s\n        end\n        \n        local cg = data.configGroup\n        \n        if cg and config.resources[cg] then\n            h = config.resources[cg].height or 20\n        end\n        \n        SetRegionSize(region, w, h)\n        LWA.UpdateBorder(region, true)\n        LWA.UpdateBar({ data = data, region = region }, index, nb)\n        \n        if region.bar.spark then\n            region.bar.spark:SetHeight(Round(h * 1.5))\n        end\n    end\n    \n    for _, resId in ipairs(data.controlledChildren) do\n        resData = WeakAuras.GetData(resId)\n        resRegion = WeakAuras.GetRegion(resData.id)\n        isVisible = isOptionsOpen or resRegion:IsVisible()\n        regionType = resData.regionType\n        h = 0\n        \n        if \"aurabar\" == regionType then\n            InitResource(resId)\n            \n        elseif \"dynamicgroup\" == regionType or \"group\" == regionType then\n            local nbChild = #resData.controlledChildren\n            \n            for i, childId in ipairs(resData.controlledChildren) do\n                InitResource(childId, i, nbChild)\n            end\n            \n            if not isOptionsOpen then\n                isVisible = (WeakAuras.GetRegion(resData.controlledChildren[1])):IsVisible()\n            end\n        end\n        \n        if isVisible then\n            nb = nb + 1\n            \n            if isVisible then\n                resRegion:SetOffset(0, -y)\n                \n                if \"dynamicgroup\" == regionType then\n                    resData.yOffset = -y\n                    \n                    resRegion:DoPositionChildren()\n                end\n            end\n            \n            totalHeight = totalHeight + h\n            y = y + h + s1\n        end\n    end\n    \n    LWA.RESOURCES_HEIGHT = totalHeight + max(nb - 1, 0) * config.primary.spacing\n    \n    WeakAuras.GetRegion(CORE_GROUP):DoPositionChildren()\n    \n    ResizeAnchorFrame()\n    \n    WeakAuras.GetRegion(MAINTENANCE_GROUP):DoPositionChildren()\n    \n    C_Timer.After(0.1, ResizeAnchorFrame)\nend\n\nfunction LWA.UpdateAbilities(newPositions, activeRegions)\n    local nb = #activeRegions\n    \n    if nb <= 0 then\n        C_Timer.After(0.125, ResizeAnchorFrame)\n        \n        return\n    end\n    \n    local config = LWA.GetConfig()\n    \n    local maxWidth = LWA.GetMaxWidth()\n    local w1 = config.primary.width\n    local h1 = config.primary.height\n    local s1 = config.primary.spacing\n    \n    \n    local maxPrimary = min(nb, config.primary.nb)\n    local x, y\n    local xOffset = ((maxPrimary - 1) * (w1 + s1) / 2)\n    local yOffset = 0\n    \n    if config.primary.resources_position == 1 then  -- Above\n        yOffset = LWA.RESOURCES_HEIGHT + s1\n    end\n    \n    for i, regionData in ipairs(activeRegions) do\n        x = (i - 1) * (w1 + s1) - xOffset\n        y = -yOffset\n        \n        SetRegionSize(regionData.region, w1, h1)\n        \n        newPositions[i] = { x, y }\n        \n        if i == maxPrimary then break end\n    end\n    \n    local maxSecondary = nb - maxPrimary\n    \n    if maxSecondary > 0 then\n        local w2 = config.secondary.width\n        local h2 = config.secondary.height\n        local s2 = config.secondary.spacing\n        \n        local nbPerRow = math.floor((maxWidth + s2) / (w2 + s2)) or 1\n        local yOffset = yOffset + h1 - h2 + max(s1, s2) - s2\n        local i2, m\n        \n        if config.primary.resources_position == 2 then -- Below\n            yOffset = yOffset + LWA.RESOURCES_HEIGHT + s1\n        end\n        \n        for i, regionData in ipairs(activeRegions) do\n            if i > maxPrimary then\n                i2 = i - maxPrimary\n                m = (i2 % nbPerRow)\n                \n                if m == 1 then\n                    xOffset = (min(maxSecondary - i + maxPrimary, nbPerRow - 1)) * (w2 + s2) / 2\n                    yOffset = yOffset + h2 + s2\n                end\n                \n                if m == 0 then\n                    m = nbPerRow\n                end\n                \n                x = (m - 1) * (w2 + s2) - xOffset\n                y = -yOffset\n                \n                SetRegionSize(regionData.region, w2, h2)\n                \n                newPositions[i] = { x, y }\n            end\n        end\n    end\n    \n    C_Timer.After(0.125, ResizeAnchorFrame)\nend\n\nfunction LWA.GetMaxWidth()\n    local config = LWA.GetConfig()\n    \n    return max(4, config.primary.nb) * (config.primary.width + config.primary.spacing) - config.primary.spacing\nend\n\nfunction LWA.UpdateBorder(region, isBar)\n    if #region.subRegions > 0 then\n        local config, size, r, g, b, a = LWA.GetConfig(), 0\n        \n        if not isBar or (isBar and config.style.apply_border) then\n            size = config.style.border_size\n            r, g, b, a = unpack(config.style.border_color)\n        end\n        \n        for _, border in ipairs(region.subRegions) do\n            if \"subborder\" == border.type then\n                border:SetVisible(size > 0)\n                \n                if size > 0 then\n                    local bd = border:GetBackdrop()\n                    bd.edgeSize = size\n                    border:SetBackdrop(bd)\n                    border:SetBorderColor(r, g, b, a)\n                end\n            end\n        end\n    end\nend\n\nlocal function MixRGB(c1, c2, pos)\n    pos = 1 - (pos or 0.5)\n    \n    local r, g, b, a\n    \n    r = (c1[1] * pos) + (c2[1] * (1 - pos))\n    g = (c1[2] * pos) + (c2[2] * (1 - pos))\n    b = (c1[3] * pos) + (c2[3] * (1 - pos))\n    a = (c1[4] * pos) + (c2[4] * (1 - pos))\n    \n    return {\n        r,\n        g,\n        b,\n        a\n    }\nend\n\nfunction LWA.UpdateBar(aura, i, nb)\n    local config = LWA.GetConfig(\"resources\")\n    local e = aura or aura_env\n    local id = e.id\n    local data = e.data or {}\n    local cg = data.configGroup\n    \n    if (not cg) or (not config[cg]) then\n        return\n    end\n    \n    cg = config[cg]\n    \n    local cs = data.colorState or \"\"\n    \n    if cs ~= \"\" then\n        cs = cs .. \"_\"\n    end\n    \n    i = (i or 1) - (data.colorOffset or 0)\n    nb = min(data.colorMax or 99, nb or 1)\n    \n    \n    local c1, c2, g = cg[cs .. \"color1\"], cg[cs .. \"color2\"], cg[cs .. \"gradient\"]\n    \n    if g then\n        if nb > 1 then\n            local cc1, cc2 = c1, c2\n            \n            if i > 1 then\n                c1 = MixRGB(cc1, cc2, (i - 1) / nb)\n            end\n            \n            c2 = MixRGB(cc1, cc2, i / nb)\n        end\n        \n        e.region.bar.fg:SetGradientAlpha(\"HORIZONTAL\", c1[1], c1[2], c1[3], c1[4], c2[1], c2[2], c2[3], c2[4])\n    else\n        e.region.bar.fg:SetVertexColor(c1[1], c1[2], c1[3], c1[4])\n    end\nend\n\nfunction LWA.DynamicBars(newPositions, activeRegions, resourceType)\n    local nb = #activeRegions\n    \n    if nb <= 0 then return end\n    \n    local config = LWA.GetConfig()\n    \n    local s = config.primary.spacing\n    \n    local maxWidth = LWA.GetMaxWidth()\n    local w, h = (maxWidth + s) / nb\n    \n    local x, y\n    local xOffset = (maxWidth - w + s) / 2\n    \n    for i, regionData in ipairs(activeRegions) do\n        x = (i - 1) * w - xOffset\n        y = 0\n        \n        regionData.region:SetRegionWidth(w - s)\n        \n        newPositions[i] = { x, y }\n    end\nend\n\nlocal function round(num, decimals)\n    local mult = 10^(decimals or 0)\n    \n    return Round(num * mult) / mult\nend\n\nlocal barFormats = {\n    \"value\",\n    \"kvalue\",\n    \"value (percent%)\",\n    \"kvalue (percent%)\",\n    \"percent%\",\n}\n\nfunction LWA.UpdateBarText(value, percent, format)\n    local text = barFormats[format] or \"value\"\n    \n    text = text:gsub(\"percent\", round(percent, 0))\n    \n    if 2 == format or 4 == format then\n        local rem = math.fmod(value, 1000) or 0\n        \n        if rem >= 950 then\n            rem = 0\n        end\n        \n        text = text:gsub(\"kvalue\", FormatLargeNumber(Round((value - rem) / 1000)) .. \".\" .. Round(rem / 100) .. \"K\"):gsub(\"%.0K\", \"K\"):gsub(\"%.\", DECIMAL_SEPERATOR)\n    else\n        text = text:gsub(\"value\", value)\n    end\n    \n    return text\nend\n\nlocal optionsCloseHandler = nil\n\nfunction LWA.OptionsClosedCheck()\n    if optionsCloseHandler then\n        optionsCloseHandler:Cancel()\n        optionsCloseHandler = nil\n    end\n    \n    if WeakAuras.IsOptionsOpen() then\n        optionsCloseHandler = C_Timer.NewTimer(0.1, LWA.OptionsClosedCheck)\n    else\n        C_Timer.After(0.1, LWA.UpdateResources)\n    end\nend",
