			["animate"] = false,
			["customGrow"] = "function(newPositions, activeRegions)\n    local nb = #activeRegions\n    \n    if nb <= 0 then return end\n    \n    local config = LWA.GetConfig()\n    \n    \n    local w = config.dynamic.width\n    local h = config.dynamic.height\n    local s1 = config.primary.spacing\n    local s2 = config.dynamic.spacing\n    \n    local x, y\n    local xOffset = 0\n    local yOffset = config.dynamic.margin + max(s1, s2) - s2 - h\n    \n    local maxWidth = LWA.GetMaxWidth() / 2\n    local nbPerRow = math.floor((maxWidth + s2) / (w + s2)) or 1\n    local xFactor, minXOffset, m = -1, 0\n    \n    \n    if config.dynamic.grow_center then\n        xFactor = 1\n        minXOffset = s2 / 2\n    end\n    \n    if config.dynamic.swap then\n        xFactor = xFactor * -1\n    end\n    \n    for i, regionData in ipairs(activeRegions) do\n        m = (i % nbPerRow)\n        \n        if m == 1 then\n            xOffset = 0\n            yOffset = yOffset + h + s2\n        end\n        \n        if m == 0 then\n            m = nbPerRow\n        end\n        \n        x = (xOffset + minXOffset) * xFactor\n        y = yOffset\n        \n        newPositions[i] = { x, y }\n        \n        xOffset = xOffset + w + s2\n    end\nend",
